import React from 'react';
import ReactDOM from 'react-dom';
import App from './App'
import Form from 'react-jsonschema-form';

const schema = `{
  "type": "object",
  "tablename": "People",
  "properties": {
    "name": {
      "type": "string"
    },
    "age": {
      "type": "integer",
      "minimum": 10,
      "maximum": 100
    },
    "married": {
      "type": "boolean",
      "default": false
    }
  },
  "required": [
    "name",
    "age",
    "married"
  ]
}`;

const schemaAsObject = JSON.parse(schema);

ReactDOM.render(
    <Form schema={schemaAsObject} />,
    //<App />,
    document.getElementById('root')
);
